INSERT INTO `booking` VALUES (7,'2023-06-01','09:00:00','오일 교환','메인터넌스',_binary '<p>엔진오일, 교환</p><p>엔진오일 필터 교환</p><p>에어크리너 교환</p><p>에어컨 필터 교환</p><p>워셔액, 냉각수 공기압 점검/보충</p>','최정비사','2023-06-07 15:02:57',NULL,'Y',2,15),(8,'2023-06-01','09:30:00','엔진경고등','터보 교환',_binary '<p>출력 저하 및 엔진 경고등으로 입고</p><p>점검시 P01101-12 터보차져 압력 불충분 메세지 확인.</p><p>탈거 후 확인시 터보 차져 내부 임펠라 손상으로 제기능 못함 확인.</p><p>터보 차져 교환 실시.</p><p>교환 후 정상 확인.</p>','강정비사','2023-06-07 15:08:48',NULL,'Y',3,17),(9,'2023-06-02','09:00:00','주행시 차에서 찌그덕 소리가 남','프론트 우측 로우암 볼조인트 소음건',_binary '<p>요철 주행시 하부에서 소음으로 인해 입고</p><p>점검시 프론트 우측 로우암 볼조인트 부싱 경화로 인한 크랙 발견</p><p>크랙으로 인한 내부 구리스 누출 확인.</p><p>볼조인트 부싱 교환&nbsp;</p><p>교환 후 시운전시 특이사항 없음</p>','박정비사','2023-06-07 15:47:43',NULL,'Y',2,13),(10,'2023-06-02','09:30:00','',NULL,NULL,NULL,NULL,NULL,'N',2,18),(11,'2023-06-02','10:00:00','',NULL,NULL,NULL,NULL,NULL,'N',2,12),(12,'2023-06-02','11:00:00','',NULL,NULL,NULL,NULL,NULL,'N',2,12),(13,'2023-06-05','09:00:00','',NULL,NULL,NULL,NULL,NULL,'N',2,12),(14,'2023-06-05','09:30:00','',NULL,NULL,NULL,NULL,NULL,'N',3,12),(15,'2023-06-05','10:00:00','',NULL,NULL,NULL,NULL,NULL,'N',4,NULL),(16,'2023-06-06','09:00:00','',NULL,NULL,NULL,NULL,NULL,'N',2,NULL),(17,'2023-06-08','09:00:00','오일 교환',NULL,NULL,NULL,NULL,NULL,'N',2,15),(18,'2023-06-30','09:00:00','오일 교환',NULL,NULL,NULL,NULL,NULL,'N',2,NULL),(19,'2023-06-30','09:30:00','오일 교환',NULL,NULL,NULL,NULL,NULL,'N',3,NULL),(20,'2023-06-30','10:00:00','오일 교환',NULL,NULL,NULL,NULL,NULL,'N',4,NULL),(21,'2023-06-30','10:30:00','오일 교환',NULL,NULL,NULL,NULL,NULL,'N',5,NULL),(22,'2023-06-30','11:00:00','오일 교환',NULL,NULL,NULL,NULL,NULL,'N',6,NULL),(23,'2023-06-30','11:30:00','오일 교환',NULL,NULL,NULL,NULL,NULL,'N',7,NULL),(24,'2023-06-30','13:00:00','오일 교환',NULL,NULL,NULL,NULL,NULL,'N',7,NULL),(25,'2023-06-30','13:30:00','오일 교환',NULL,NULL,NULL,NULL,NULL,'N',8,NULL),(26,'2023-06-30','14:00:00','오일 교환',NULL,NULL,NULL,NULL,NULL,'N',9,NULL),(27,'2023-06-30','14:30:00','오일 교환',NULL,NULL,NULL,NULL,NULL,'N',10,NULL),(2