DROP TABLE IF EXISTS `members`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `members` (
  `id` int NOT NULL AUTO_INCREMENT,
  `mem_type` enum('A','C','T') CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '멤버 유형 A-관리자,  C-고객, T-정비사',
  `mem_id` varchar(100) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '멤버 아이디',
  `mem_pw` varchar(180) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '멤버 비밀번호',
  `name` varchar(45) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '이름',
  `tel` varchar(45) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '연락처',
  `email` varchar(180) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '이메일',
  `birthdate` varchar(45) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '생년월일',
  `carno` varchar(45) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '차번호',
  `carmo` varchar(45) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '차종',
  `postcode` varchar(10) CHARACTER SET utf8 COLLATE utf8_bin NOT NULL COMMENT '우편번호',
  `addr1` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '기본주소',
  `addr2` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '상세주소',
  `level` varchar(45) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '멤버유형 중 정비사의 등급',
  `reg_date` datetime NOT NULL COMMENT '맴버등록일시',
  `edit_date` datetime DEFAULT NULL COMMENT '멤버정보수정일시',
  `is_out` enum('Y','N') CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '탈퇴여부',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=25 DEFAULT CHARSET=utf8 COLLATE=utf8_bin;
